    - description: 'query for searching accounts'
      name: query
      required: false
    - description: 'Comma separated list of fields to retrieve'
      name: fields
      required: false
      defaultValue: "name, id, recordLink, tech_BD_Assigned_for_XSOAR__cf"
    - description: 'Optional where clause (eg, Field1 = Val1 and Field2 > Val2)'
      name: filter
      required: false
    - description: 'Comma separated list of fields to sort by'
      name: orderby
      required: false
    - description: 'Number of results to skip for pagination'
      name: skip
      required: false
    - description: 'Number of results to take for pagination'
      name: take
      required: false
    - auto: PREDEFINED
      description: "Whether to return all results"
      name: all_fields
      predefined:
        - TRUE
        - FALSE
      defaultValue: 'FALSE'
    description: 'Get account IDs from Impartner'
    name: impartner-get-account-list
    outputs:
    - contextPath: Impartner.Account.list.count
      description: Number of results returned
      type: String
    - contextPath: Impartner.Account.list.entity
      description: Type of entity returned
      type: String
    - contextPath: Impartner.Account.list.results
      description: Type of entity returned
      type: Array
    - contextPath: Impartner.Account.list.results.id
      description: ID of account
      type: String
    - contextPath: Impartner.Account.list.success
      description: Whether result was successful
      type: Boolean
  - arguments:
    - description: 'id of Impartner account'
      name: id
      required: false
    - description: 'Comma separated list of fields to retrieve'
